import React , { Component }from 'react';
import './App.css';
import Map from './Components/Map'
class App extends Component {

  constructor(props){

    super(props);
    this.state = {
      pointer:{lat:'30.741482',long:'76.768066'}
    }

  }

  render(){
    return(
      <div className="App">
       <Map pointer={this.state.pointer} googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyBqqW5pq28Qera8ScOykfyKpiIP5Cc0XAM"
    loadingElement={<div style={{ height: `100%` }} />}/>
      </div>
    )
    }

}

export default App;
